import kat from "./fetcher"
import React, { useEffect, useState } from 'react';

export default function Home() {









  return (
<div>  

  <h1 className="title"> Looking for a specific food or destination? Let <span className="logo">TravelEat </span> help! </h1>

  <div className="container"> 
      <div>    
        <input className="searchContainer" type="text" placeholder="Food or Destination"></input>
      </div>
  </div>
        <button className="searchButton" type="button" >Search</button>
        <div id="result" className="returnedResult" onClick={kat.apply} ></div>
</div> 
  );
  }
